#define int int64_t

#define rng(i, a, b) for (int i = a; i < b; i++)
#define rep(i, b) rng(i, 0, b)
#define gnr(i, a, b) for (int i = b - 1; i >= a; i--)
#define per(i, b) gnr(i, 0, b)

#define all(x) begin(x), end(x)
#define sz(x) int(size(x))

#define pb push_back
#define eb emplace_back
#define lb lower_bound
#define ub upper_bound

#define f first
#define s second

using namespace std;
using namespace __gnu_pbds;

mt19937_64 _rng(chrono::steady_clock::now().time_since_epoch().count());

const int64_t MOD = (1ll << 61) - 1;
const int64_t B = uniform_int_distribution<int64_t>(1e3, MOD - 1e3)(_rng);

vector<int64_t> pow_b = {1};

template <typename T>
struct Hash {
    T s;
    vector<int64_t> h;

    Hash(T _s) : s(_s) {
        h.resize(sz(s) + 1);
        for (int i = 0; i < sz(s); i++) {
            h[i + 1] = (__int128_t(h[i]) * B + s[i]) % MOD;
        }
        while (sz(pow_b) < sz(h)) {
            pow_b.pb(__int128_t(pow_b.back()) * B % MOD);
        }
    }

    int64_t get_hash(int l, int r) {
        return ((h[r] - __int128_t(h[l]) * pow_b[r - l]) % MOD + MOD) % MOD;
    };
};

void solve() {
    int n, m;
    cin >> n >> m;

    vector<Hash<string>> a;
    rep(i, n) {
        string s;
        cin >> s;
        a.pb(Hash(s));
    }
    vector<Hash<string>> b;
    rep(i, n) {
        string s;
        cin >> s;
        b.pb(Hash(s));
    }

    auto disjoint = [&](int l, int r) -> bool {
        unordered_set<int> a_cont;
        rep(i, n) {
            a_cont.insert(a[i].get_hash(l, r));
        }
        rep(i, n) {
            if (a_cont.count(b[i].get_hash(l, r))) {
                return false;
            }
        }
        return true;
    };

    int ans = 1e9;
    rep(i, m) {
        int r = m + 1;
        for (int j = 1 << 8; j != 0; j >>= 1) {
            if (r - j > i && disjoint(i, r - j)) {
                r -= j;
            }
        }
        if (r != m + 1) {
            ans = min(ans, r - i);
        }
    }
    cout << ans << '\n';
}

