int num_iter = 0;

void move(int* from, int* to) {
	num_iter++;
	int k = 0;
	while (k < n && from[k] == 0)
		k++;
	int m = 0;
	while (m < n && to[m] == 0)
		m++;	
	
	if (k < n)
		if (m > 0 && ((m == n) || from[k] < to[m])) {			
			to[m - 1] = from[k];
			from[k] = 0;
		}
}

bool is_good() {
	for (int k = 0; k < n - 1; k++) {
		if (a[k + 1] < a[k] ||
			b[k + 1] < b[k] ||
			c[k + 1] < c[k])
			return false;
	}
	return true;
}

void hanoi() {
	init();
	//cout << is_good();
	show_towers();
	move(a, c);
	show_towers();
	move(a, b);
	show_towers();
	move(c, b);
	show_towers();
	move(a, c);
	show_towers();
	move(b, a);
	show_towers();
	move(b, c);
	show_towers();
	move(a, c);
	show_towers();
}

void hanoi_solver(int m, int* from, int* tmp, int* to) {
	if (m > 0) {
		hanoi_solver(m - 1, from, to, tmp);
		move(from, to);
		show_towers();
		hanoi_solver(m - 1, tmp, from, to);
	}
}

void test_play() {
	init();
	show_towers();
	hanoi_solver(n, a, b, c);
	cout << num_iter << endl;
}

